INSERT INTO `question` (`question_id`, `question`, `insert_dt`, `update_dt`, `is_deleted`) VALUES
	(1, 'In the last 3 months, how often did you have pain anywhere in your abdomen? \r\n', NULL, NULL, 0),
	(2, 'How often did this pain in your abdomen happen close in time to a bowel movement—just before, during, or soon after? (Percent of times with pain) ', NULL, NULL, 0),
	(3, 'How often did your stools become either softer than usual or harder than usual when you had this pain? (Percent of times with pain) \r\n', NULL, NULL, 0),
	(4, 'how  often did your stools become either more frequent than usual or less frequent than usual when you had this pain? (Percent of times with pain) \r\n', NULL, NULL, 0),
	(5, 'For women: How often did your  pain get worse with menstrual bleeding? (Percent of times with pain) \r\n', NULL, NULL, 0),
	(6, 'How often did your pain start or get worse after eating a meal? (Percent of times with pain) \r\n', NULL, NULL, 0),
	(7, 'When you had this pain, how often did it limit or restrict your usual activities (for example, work, household activities, and social events)? (Percent of times with pain) \r\n', NULL, NULL, 0),
	(8, 'Has this pain in your abdomen been continuous or almost continuous? (Continuous means that it never goes away during waking hours) \r\n', NULL, NULL, 0),
	(9, 'Has it been 6 months or longer since you started having this pain?\r\n', NULL, NULL, 0),
	(10, 'In the last 3 months, how often did you have hard or lumpy stools that looked like Type 1 or 2 in the picture below? (Percent of all bowel movements) \r\n', NULL, NULL, 0),
	(11, 'In the last 3 months, how often did you have fewer than three bowel movements a week without taking a laxative medication or enema? (Percent of weeks) \r\n', NULL, NULL, 0),
	(12, 'In the last 3 months, how often did you strain during bowel movements? (Percent of bowel movements) \r\n', NULL, NULL, 0),
	(13, 'In the last 3 months, how often did you have a feeling of incomplete emptying after bowel movements? (Percent of bowel movements)\r\n', NULL, NULL, 0),
	(14, 'In the last 3 months, how often did you have a sensation that the stool could not be passed (was blocked) when having a bowel movement? (Percent of bowel movements) \r\n', NULL, NULL, 0),
	(15, 'In the last 3 months, how often did you press on or around your bottom, or remove stool with your fingers, in order to have a bowel movement? (Percent of bowel movements) \r\n', NULL, NULL, 0),
	(16, 'Did any of the symptoms of constipation listed in questions 49-55 above begin more than 6 months ago? \r\n', NULL, NULL, 0),
	(17, 'Are you currently taking a prescription medication for pain? \r\n', NULL, NULL, 0),
	(18, 'Have any of the constipation symptoms listed in questions 49-55 above changed since you started taking prescription medication for pain? \r\n', NULL, NULL, 0),
	(19, 'In the last 3 months, how often did you have mushy or watery stools that looked like Type 6 or 7 in the picture below when you were not using drugs or other treatment for constipation? (percent of all bowel movements) \r\n', NULL, NULL, 0),
	(20, 'Did you have mushy and watery stools (like Type 6 or 7) when you were not using drugs or other treatment for constipation?\r\n', NULL, NULL, 0),
	(21, 'How often did your symptom of mushy or watery stools happen following a meal?(Percent of 20% mushy or liquid stools) \r\n', NULL, NULL, 0),
	(22, 'Has it been 6 months or longer since you started having frequent mushy or watery stools? \r\n', NULL, NULL, 0),
	(23, 'In the last 3 months, how often did you have to rush to the toilet to have a bowel movement? (Percent of bowel movements) \r\n', NULL, NULL, 0),
	(24, 'In the last 3 months, when you had abnormal stools, what were they usually like? \r\n', NULL, NULL, 0),
	(25, 'In the last 3 months, how often did you feel bloated or notice that your belly looked unusually large? \r\n', NULL, NULL, 0),
	(26, 'Has it been 6 months or longer since you started having this problem of feeling bloated or your belly looking unusually large? \r\n', NULL, NULL, 0),
	(27, 'Which of the following has been the most bothersome symptom for you in the last 3 months? \r\n', NULL, NULL, 0);
